import React from 'react'

function Card(props) {
  return (
    <div className='card-item'>
      <img src={props.item.imageUrl} alt='Image'/>
      <h3>{props.item.name}</h3>
      <h5>{props.item.price}</h5>
    </div>
  )
}

export default Card
